import {Routes , Route} from 'react-router-dom';


const Main = () => {
    return(

        <>
            <Routes>
                <Route path = '/' element = {<h1>this is main inside </h1>} />
                <Route path='/about' element={<h1>this is about inside </h1>} />
            </Routes>
           

        </>

    )
}

export default Main;
